void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
  fragColor = mod(
    vec4(
      (1.2 - 0.6),
      iTime,
      (0.1 / 1.7),
      fract(0.0)
    ),
    normalize(
      vec4(
        0.9,
        1.4,
        0.0,
        (gl_FragCoord.y / iResolution.y)
      )
    )
  );
}
